import React from 'react'
import c from './Navbar.module.css'

const Navbar = () => {
return(
    <nav className={c.nav}>
    <div className={c.item}>
      <a>Profile</a>
    </div>
    <div className={c.item}>
      <a>Messages</a>
    </div>
    <div className={c.item}>
      <a>News</a>
    </div>
    <div className={c.item}>
      {/*<a href='#'>Music</a>*/}
    </div>
    <div className={c.item}>
      {/*<a href='#'>Settings</a>*/}
    </div>
  </nav>
)}

export default Navbar;
